import React, {Component} from 'react';
import Host2 from "./Host2";

class Host2S extends Component {
    render() {
        return (
            <div className="row">
                <Host2 classicon="fab fa-wordpress" tieude="WordPress hosting giá rẻ nhất" mota="Với đội ngũ giám sát 24/7 và công nghệ clustering đặc biệt giúp hệ thống luôn hoạt động liên tục"/>
                <Host2 classicon="fas fa-money-check-alt" tieude="Tiết kiệm đáng kể" mota="P.A Vietnam là đơn vị đầu tiên tại VN cam kết sử dụng Phần mềm có bản quyền cung cấp dịch vụ cho khách hàng"/>
                <Host2  classicon="fas fa-rocket" tieude="Tốc độ cao" mota="Máy chủ sử dụng CPU thế hệ mới nhất của Intel và công nghệ lưu trữ SSD raid 10 nhanh và an toàn dữ liệu nhất"/>
            </div>
        );
    }
}

export default Host2S;
